import React, { Component } from "react";
import Header from "../../component/Header/Header";

import { Background } from "./styles/HomePage";

class HomePage extends Component {
  render() {
    return (
      <>
        <Header />
        <Background>
          <Title>This is Home page</Title>
        </Background>
      </>
    );
  }
}

export default HomePage;
